window.bookSummaryJSON = "<p><b>The first time she knew real happiness was when she found out that the man who raised her wasn't her real father.</b></p> <p>She thought there couldn't be monsters in the world that were any worse than the monster she had called 'daddy' for most of her life. Then she stumbled into the world of demons.</p> <p>The Demon King knew the second his fated mate had been brought into the world. After living years too numerous to count, it meant little to him other than to keep him from living as he had. He now belonged to only one femaleâ€”and he would have to wait years for her to mature enough to matter.</p> <p>How stupid and vain he had been to think that his fated wouldn't matter. The very moment she entered his club, he knew he had been wrong to ignore fate.</p> <p>She was<b><i> </i></b>his. He would destroy everyone that hurt her, even if he had to burn the Earth realm to the ground.</p>"; 
